userDefinedLinkHintCss:
div > .vimiumHintMarker {
/* linkhint boxes */
background: #1b1b1b;
border: 1px solid gray;
}

div > .vimiumHintMarker span {
/* linkhint text */
color: white;
font-weight: normal;
font-size: 14px;
}

div > .vimiumHintMarker > .matchingCharacter {
color: yellow;
font-weight: normal;
font-size: 14px;
}
